    "ChannelChangeText": {                           "en": "Channel sets the used radio frequency. It may be changed to avoid conflicts with existing wifi networks. <b>All devices must be relearned when changing!</b>", "de": "Kanal stellt die verwendete Funkfrequenz ein. Es kann geändert werden, um Konflikte mit vorhandenen WLAN-Netzwerken zu vermeiden. <b>Alle Geräte müssen beim Wechsel neu gelernt werden!</b>", "ru": "Канал устанавливает используемую радиочастоту. Его можно изменить, чтобы избежать конфликтов с существующими сетями Wi-Fi. <b>При замене все устройства необходимо переучивать!</b>", "pt": "Canal define a freqüência de rádio usada. Pode ser alterado para evitar conflitos com redes wi-fi existentes. <b>Todos os dispositivos devem ser reaprendidos ao mudar!</b>", "nl": "Gewenste radiofrequentie instellen. Deze kan worden aangepast om conflicten met bestaande wifi-netwerken te voorkomen. <b>Bij wijzigingen moeten alle apparaten opnieuw aangeleerd worden!</b>", "fr": "Channel définit la fréquence radio utilisée. Il peut être modifié pour éviter les conflits avec les réseaux wifi existants. <b>Tous les appareils doivent être réappris lors du changement!</b>", "it": "Canale imposta la frequenza radio utilizzata. Può essere modificato per evitare conflitti con le reti Wi-Fi esistenti. <b>Tutti i dispositivi devono essere riappresi quando si cambia!</b>", "es": "Canal establece la frecuencia de radio utilizada. Puede cambiarse para evitar conflictos con las redes wifi existentes. <b>¡Todos los dispositivos se deben volver a aprender al cambiar!</b>", "pl": "Kanał ustawia używaną częstotliwość radiową. Można go zmienić, aby uniknąć konfliktów z istniejącymi sieciami Wi-Fi. <b>Podczas zmiany wszystkie urządzenia muszą zostać ponownie nauczone!</b>", "zh-cn": "频道设置使用的无线电频率。可以更改它以避免与现有的wifi网络冲突。 <b>更改时必须重新学习所有设备！</b>"},
