    "ExtPanIDText": {                                "en": "Extended PAN ID is the main network id, comparable to SSID of wifi networks. This id must never change for existing networks, else you have to reset and repair your devices. If you use multiple Zigbee adapters, you <b>must make sure</b> that they use unique Extended PAN IDs. Just enter 16 random hex character (a-f and 0-9).", "de": "Die erweiterte PAN-ID ist die Hauptnetzwerk-ID, vergleichbar mit der SSID von WLAN-Netzwerken. Diese ID darf sich für vorhandene Netzwerke niemals ändern, da du sonst deine Geräte zurücksetzen und neu koppeln musst. Wenn du mehrere ZigBee-Adapter verwendest, <b>musst</b> du <b>sicherstellen,</b> dass diese eindeutige ExtPanIDs verwenden. Gib einfach 16 zufällige Hex-Zeichen ein (a-f und 0-9).", "ru": "Расширенный PAN ID - это основной идентификатор сети, сравнимый с SSID сетей Wi-Fi. Этот идентификатор никогда не должен изменяться для существующих сетей, иначе вам придется перезагрузить и восстановить свои устройства. Если вы используете несколько адаптеров Zigbee, вы <b>должны убедиться,</b> что они используют уникальные ExtPanID. Просто введите 16 случайных шестнадцатеричных символов (af и 0-9).", "pt": "PAN ID estendido é o ID de rede principal, comparável ao SSID de redes wi-fi. Esta identificação nunca deve ser alterada para redes existentes, caso contrário, você terá que redefinir e reparar seus dispositivos. Se você usar vários adaptadores Zigbee, <b>certifique-se de</b> que eles usam ExtPanIDs exclusivos. Basta inserir 16 caracteres hexadecimais aleatórios (af e 0-9).", "nl": "Uitgebreide PAN-ID is het hoofdnetwerk-ID, vergelijkbaar met de SSID van wifi-netwerken. Dit ID mag nooit veranderen voor bestaande netwerken, anders moet je alle apparaten resetten en opnieuw aanleren. Als je meerdere Zigbee-adapters gebruikt, <b>moet je ervoor zorgen</b> dat ze unieke ExtPanID's gebruiken. Voer gewoon 16 willekeurige hexadecimale tekens in (a-f en 0-9).", "fr": "ID PAN étendue est l'identifiant principal du réseau, comparable au SSID des réseaux wifi. Cet identifiant ne doit jamais changer pour les réseaux existants, sinon vous devez réinitialiser et re-coupler vos appareils. Si vous utilisez plusieurs adaptateurs Zigbee, vous <b>devez vous assurer</b> qu'ils utilisent des ExtPanID uniques. Entrez simplement 16 caractères hexadécimaux aléatoires (a-f et 0-9).", "it": "Il PAN ID esteso è l'id della rete principale, paragonabile all'SSID delle reti wifi. Questo ID non deve mai cambiare per le reti esistenti, altrimenti devi ripristinare e riparare i tuoi dispositivi. Se si utilizzano più adattatori Zigbee, è <b>necessario assicurarsi</b> che utilizzino ExtPanID univoci. Basta inserire 16 caratteri esadecimali casuali (af e 0-9).", "es": "El ID de PAN extendido es el ID de red principal, comparable al SSID de las redes wifi. Esta identificación nunca debe cambiar para las redes existentes, de lo contrario, debe restablecer y reparar sus dispositivos. Si utiliza varios adaptadores Zigbee, <b>debe asegurarse de</b> que utilicen ExtPanID únicos. Simplemente ingrese 16 caracteres hexadecimales aleatorios (af y 0-9).", "pl": "Rozszerzony identyfikator PAN jest głównym identyfikatorem sieci, porównywalnym z identyfikatorem SSID sieci Wi-Fi. Ten identyfikator nigdy nie może się zmieniać w istniejących sieciach, w przeciwnym razie musisz zresetować i naprawić swoje urządzenia. Jeśli używasz wielu adapterów Zigbee, musisz <b>upewnić się</b> , że używają one unikalnych identyfikatorów ExtPanID. Wystarczy wpisać 16 losowych znaków szesnastkowych (af i 0-9).", "zh-cn": "扩展PAN ID是主要网络ID，与wifi网络的SSID相当。对于现有网络，此ID绝不能更改，否则您必须重置和修复设备。如果使用多个Zigbee适配器，则<b>必须确保</b>它们使用唯一的ExtPanID。只需输入16个随机十六进制字符（af和0-9）。"},
