    "Reset Info": {                                  "en": "A soft reset will just restart routines and the CC253x. A hard reset will clear paired devices data and reset CC253x settings too. You will have to repair ALL of your devices!", "de": "Ein Soft-Reset startet nur den CC253x Adapter und die zugehörige Software neu. Ein Hard-Reset setzt die Liste ALLER gekoppelten Geräte und die CC253x Einstellungen zurück! Alle Geräte müssen anschließend neu gekoppelt werden!", "ru": "Soft reset - просто перезапускает процессы в CC253x. Hard-Reset - очищает данные по всем связанным устройствам и сбрасывает настройки CC253x тоже. Вам нужно будет заново выполнить сопряжение всех устройств!", "pt": "A Soft reset will just restart routines and CC253x. Hard-Reset will clear paired devices data and it resets CC253x settings too. You will have to repair ALL of your devices!", "nl": "Een zachte reset herstart de routines en CC253x. Met een harde reset worden gegevens van gekoppelde apparaten gewist en ook de CC253x-instellingen gereset. U moet AL uw apparaten opnieuw aanleren!", "fr": "Un redémarrage en douceur redémarrera uniquement les routines et le  CC253x. Une réinitialisation matérielle efface les données de dispositifs couplés et réinitialise aussi la configuration du CC253x. Vous devez re-coupler TOUS vos dispositifs!", "it": "A Soft reset will just restart routines and CC253x. Hard-Reset will clear paired devices data and it resets CC253x settings too. You will have to repair ALL of your devices!", "es": "A Soft reset will just restart routines and CC253x. Hard-Reset will clear paired devices data and it resets CC253x settings too. You will have to repair ALL of your devices!", "pl": "A Soft reset will just restart routines and CC253x. Hard-Reset will clear paired devices data and it resets CC253x settings too. You will have to repair ALL of your devices!", "zh-cn": "设备重置"},
