    "Select your settings. Then click RUN to send command to your Zigbee device.": {"en": "Select your settings. Then click RUN to send command to your Zigbee device.", "de": "Wähle deine Einstellungen. Klicke dann auf Ausführen, um den Befehl an das ZigBee-Gerät zu senden.", "ru": "Выберите свои настройки. Затем нажмите RUN, чтобы отправить команду на ваше устройство Zigbee.", "pt": "Selecione suas configurações. Em seguida, clique em EXECUTAR para enviar o comando ao seu dispositivo Zigbee.", "nl": "Selecteer uw instellingen. Klik vervolgens op UITVOEREN om het commando naar je Zigbee-apparaat te sturen.", "fr": "Sélectionnez vos paramètres. Cliquez ensuite sur EXÉCUTER pour envoyer la commande à votre appareil Zigbee.", "it": "Seleziona le tue impostazioni. Quindi fare clic su ESEGUI per inviare il comando al dispositivo Zigbee.", "es": "Seleccione su configuración. Luego haga clic en EJECUTAR para enviar el comando a su dispositivo Zigbee.", "pl": "Wybierz swoje ustawienia. Następnie kliknij URUCHOM, aby wysłać polecenie do urządzenia Zigbee.", "zh-cn": "选择您的设置。然后单击运行以将命令发送到您的Zigbee设备。"},
