    "Some kind of 'device within device'. Every endpoint may have different functions. If one does not work, test another.": {"en": "Some kind of 'device within device'. Every endpoint may have different functions. If one does not work, test another.", "de": "Eine Art \"Gerät in Gerät\". Jeder Endpunkt kann unterschiedliche Funktionen haben. Wenn einer nicht funktioniert, testen Sie einen anderen.", "ru": "Какое-то «устройство внутри устройства». Каждая конечная точка может иметь разные функции. Если один не работает, проверьте другой.", "pt": "Algum tipo de 'dispositivo dentro do dispositivo'. Cada terminal pode ter funções diferentes. Se um não funcionar, teste outro.", "nl": "Een soort 'apparaat in apparaat'. Elk eindpunt kan verschillende functies hebben. Als de een niet werkt, test dan een andere.", "fr": "Une sorte de «périphérique dans le périphérique». Chaque point de terminaison peut avoir des fonctions différentes. Si l'un ne fonctionne pas, testez-en un autre.", "it": "Una sorta di \"dispositivo nel dispositivo\". Ogni endpoint può avere funzioni diverse. Se uno non funziona, provane un altro.", "es": "Algún tipo de \"dispositivo dentro del dispositivo\". Cada punto final puede tener diferentes funciones. Si uno no funciona, pruebe otro.", "pl": "Coś w rodzaju „urządzenia w urządzeniu”. Każdy punkt końcowy może mieć różne funkcje. Jeśli jeden nie działa, przetestuj inny.", "zh-cn": "某种“设备中的设备”。每个端点可能具有不同的功能。如果一个不起作用，请测试另一个。"},
