    "Switch expert mode to enter raw data, sent to zigbee device.": {"en": "Switch to expert mode to enter raw data, sent to the Zigbee device.", "de": "Wechseln Sie in den Expertenmodus, um Rohdaten einzugeben, die an das ZigBee-Gerät gesendet werden.", "ru": "Переключите экспертный режим, чтобы ввести необработанные данные, отправленные на устройство zigbee.", "pt": "Alterne o modo especialista para inserir dados brutos, enviados para o dispositivo zigbee.", "nl": "Wissel van expertmodus om onbewerkte gegevens in te voeren, verzonden naar het zigbee-apparaat.", "fr": "Basculez en mode expert pour saisir des données brutes, envoyées à l'appareil zigbee.", "it": "Passa alla modalità esperto per inserire dati grezzi, inviati al dispositivo zigbee.", "es": "Cambie el modo experto para ingresar datos brutos, enviados al dispositivo zigbee.", "pl": "Przełącz tryb ekspercki, aby wprowadzić surowe dane wysłane do urządzenia zigbee.", "zh-cn": "切换专家模式以输入原始数据，并将其发送到zigbee设备。"},
