    "The value to send to your device (use douple-quotes if a number is a string).": {"en": "The value to send to your device (use double-quotes if a number is a string).", "de": "Der Wert, der an Ihr Gerät gesendet werden soll (verwenden Sie doppelte Anführungszeichen, wenn eine Zahl eine Zeichenfolge ist).", "ru": "Значение для отправки на ваше устройство (используйте двойные кавычки, если число является строкой).", "pt": "O valor a ser enviado ao seu dispositivo (use aspas duplas se um número for uma string).", "nl": "De waarde die naar uw apparaat moet worden verzonden (gebruik dubbele aanhalingstekens als een getal een tekenreeks is).", "fr": "La valeur à envoyer à votre appareil (utilisez des guillemets doubles si un nombre est une chaîne).", "it": "Il valore da inviare al tuo dispositivo (usa virgolette doppie se un numero è una stringa).", "es": "El valor para enviar a su dispositivo (use comillas dobles si un número es una cadena).", "pl": "Wartość do wysłania do urządzenia (użyj podwójnych cudzysłowów, jeśli liczba jest łańcuchem).", "zh-cn": "要发送到设备的值（如果数字是字符串，请使用双引号）。"},
    "This page is needed only for advanced users that like to extend adapter functionalities!": {"en": "This page is needed only for advanced users that like to extend adapter functionalities!", "de": "Diese Seite wird nur von fortgeschrittenen Benutzern benötigt, die die Adapterfunktionen erweitern möchten!", "ru": "Эта страница нужна только опытным пользователям, которые хотят расширить функциональные возможности адаптера!", "pt": "Esta página é necessária apenas para usuários avançados que gostam de estender as funcionalidades do adaptador!", "fr": "Cette page n'est nécessaire que pour les utilisateurs avancés souhaitant étendre les fonctionnalités de l'adaptateur!", "it": "Questa pagina è necessaria solo per utenti avanzati che desiderano estendere le funzionalità dell'adattatore!", "es": "Esta página es necesaria solo para usuarios avanzados que deseen ampliar las funcionalidades del adaptador.", "pl": "Ta strona jest potrzebna tylko zaawansowanym użytkownikom, którzy lubią rozszerzać funkcje adaptera!", "zh-cn": "只有喜欢扩展适配器功能的高级用户才需要此页面！"},
    "Touchlink reset and pairing": {                 "en": "Touchlink reset and pairing",                     "de": "Touchlink zurücksetzen und koppeln",              "ru": "Сброс Touchlink и сопряжение",                    "pt": "Redefinição e pareamento do touchlink",           "nl": "Touchlink resetten en koppelen",                  "fr": "Réinitialisation et couplage de Touchlink",       "it": "Reimpostazione e associazione del touchlink",     "es": "Restablecimiento y emparejamiento de Touchlink",  "pl": "Resetowanie i parowanie za pomocą Touchlink",     "zh-cn": "触摸链接重置和配对"},
    "Transport Kex Text": {                          "en": "Transport Key is the network encryption key. Please choose a random key sequence <b>before</b> you pair your devices. Just enter 32 random hex character (a-f and 0-9). If you change the key later, you will have to repair your devices.", "de": "Transportschlüssel ist der Netzwerkverschlüsselungsschlüssel.  Bitte wähle eine zufällige Schlüsselsequenz <b>bevor</b> du Geräte koppelst. Gib einfach 32 zufällige Hex-Zeichen ein (a-f und 0-9). Wenn du den Schlüssel später änderst, musst du alle Geräte neu koppeln.", "ru": "Транспортный ключ - это сетевой ключ шифрования. ", "pt": "Chave de transporte é a chave de criptografia da rede. ", "nl": "Transportsleutel is de netwerkversleutelingssleutel. Kies een willekeurige toetsenreeks <b> voordat </b> u uw apparaten koppelt. Voer gewoon 32 willekeurige hexadecimale tekens in (a-f en 0-9). Als u de sleutel later wijzigt, moet u alle apparaten opnieuw aanleren.", "fr": "La clé de transport est la clé de chiffrement du réseau.  Choisissez s.v.p. une chaîne <b>avant</b> de coupler vos dispositifs. Entrez simplement 32 caractères hexadécimaux aléatoires (a-f et 0-9). Si vous changez la clé plus tard, vous devez re-coupler vos  dispositifs.", "it": "La chiave di trasporto è la chiave di crittografia della rete. ", "es": "Transport Key es la clave de cifrado de red. ",   "pl": "Klucz transportowy to sieciowy klucz szyfrowania. ", "zh-cn": "传输密钥是网络加密密钥。"},
    "Transport Key": {                               "en": "Transport Key",                                   "de": "Transportschlüssel",                              "ru": "Транспортный ключ",                               "pt": "Chave de transporte",                             "nl": "Transport sleutel",                               "fr": "Clé de transport",                                "it": "Chiave di trasporto",                             "es": "Transporte clave",                                "pl": "Klucz transportowy",                              "zh-cn": "运输钥匙"},
